    false,nt"url": null,nt"notes": "The primary objective of this study was
    to conduct a probabilistic ecological risk assessment for birds and evaluate risk
    to fish and mammals that may be exposed to mercury at the Great Dismal Swamp National
    Wildlife Refuge (Refuge). The primary source of mercury is atmospheric deposition.
    Low dissolved oxygen and pH in the waters throughout the Refuge provide favorable
    conditions for the conversion of inorganic mercury to the more toxic form methylmercury.
    The daily intakes of mercury for three breeding bird species (bald eagle, belted
    kingfisher, and great blue heron) in the Refuge were estimated using Monte Carlo
    simulation, using measured prey mercury concentrations and literature-based values
    for some parameters.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
